    <Router>
      <MyNavbar />
      <div className="container mt-4">
        <Routes>  {/* Aquí se usa Routes en vez de Switch */}
          <Route exact path="/" element={<HomePage />} />  {/* Cambié component por element */}
          {/* Agrega otras rutas aquí */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
